'use strict';

// MODULES //

var tape = require( 'tape' );
var isStringArray = require( '@stdlib/utils/is-string' ).isPrimitiveStringArray;
var list = require( './../lib' );


// TESTS //

tape( 'main export is an array of string primitives', function test( t ) {
	t.ok( true, __filename );
	t.equal( isStringArray( list ), true, 'main export is an array of string primitives' );
	t.equal( list.length, 50, 'has length of 50' );
	t.end();
});
